import React from 'react';
import RegistroSection from './Como-Funciona/RegistroSection';
import ColetaSection from './Como-Funciona/ColetaSection';
import TriagemSection from './Como-Funciona/TriagemSection';
import EntregaSection from './Como-Funciona/EntregaSection';



function ComoFunciona() {
  return (
    <div>
      <RegistroSection/>
      <ColetaSection/>
      <TriagemSection/>
      <EntregaSection/>
    </div>
  );
}

export default ComoFunciona;
